import React, { useState } from 'react';
import '../App.css';
import logo from "../img/logo.png"
import { useNavigate } from 'react-router-dom';
import { BrowserRouter as Router, Route, Routes} from 'react-router-dom';

import {withRouter} from 'react-router-dom';
import EntraCaixa from './EntrarCaixa';



function Formulario({navigation}){
    //const history = useNavigate();
    const navigate = useNavigate()
    
    const [formData, setFormData] = useState({
        login: '2001...', 
        senha: '123...', 
    });
    
    const handleInputChange = (event) => {
        const { name, value } = event.target;
        setFormData((prevData) => ({
          ...prevData,
          [name]: value,
        }));
    };

    const handleSubmit = (event) => {
        
        navigate("./pages/EntrarCaixa", { replace: true });


        event.preventDefault();
        //navigate('./EntrarCaixa.js');// .push('./EntrarCaixa.js');
        //history.push('./EntrarCaixa.js');
        
        /*axios.post('http://127.0.0.1:5000/api/sendDados', formData)
          .then(response => {
            console.log('Resposta do servidor:', response.data);
          })
          .catch(error => {
            console.error('Erro ao enviar dados:', error);
          });*/
      };
    

    return (
      <Router>
        <form onSubmit={handleSubmit}>
            <div className='form'>
                <img src={logo} className='logo'/>
                <label>
                    Login:<br/>
                    <input 
                        name="login" 
                        className='dadosLogin' 
                        value={formData.login}
                        onChange={handleInputChange} />
                </label>
                <label>
                    Senha:<br/>
                    <input 
                        name="senha" 
                        className='dadosLogin' 
                        value={formData.senha}
                        onChange={handleInputChange} />
                </label>
                <button type="submit"> Login </button>
            </div>
        </form>

        <Routes>
        
        <Route path="./pages/EntrarCaixa" element={<EntraCaixa/>}/>
        
       </Routes>
      </Router>
        

        
  );
}

export default Formulario;
